import React, { lazy, Suspense } from "react";
const FormRegister = lazy(() => import("../components/FormRegister"));
const LayoutRegister = lazy(() => import("./LayoutRegister"));

const Register = () => {
  return (
    <Suspense fallback={<div>Loading...</div>}>
    <LayoutRegister>
      <br />
      <div class="columns is-vcentered">
        <div class="column is-6 ml-6">
          <img
            className=""
            src="https://99usahaku.com/logo.png"
            alt="image"
            width="500"
            height="500"
          />
        </div>
        <div class="column mr-6">
          <FormRegister />
        </div>
      </div>
    </LayoutRegister>
    </Suspense>
  );
};

export default Register;
